import axios from "axios";
import * as api from "../../api/dynamicCard.js"


export const fetchCardDatas = () => async (dispatch) => {
    try {
        const { data } = await api.getCardData();
        console.log(data?.Class_11_Chemistry);
    } catch (error) {
        console.log(error)
    }
}
